import React from "react";
import { Layout, Menu, Icon, Breadcrumb } from "antd";
import "./defaultLayout.css";
import { Link } from "react-router-dom";
import Form from "../form/index";
import Headers from "../header/header";
import { LayoutProvider } from "react-page-layout";
//import Form from '../form/index'

const SubMenu = Menu.SubMenu;

const { Header, Sider, Content, Footer } = Layout;

class Defaultlayout extends React.Component {
  state = {
    collapsed: false
  };

  toggle = () => {
    this.setState({
      collapsed: !this.state.collapsed
    });
  };

  onCollapse = collapsed => {
    console.log(collapsed);
    this.setState({ collapsed });
  };

  render() {
    console.log(this.props.children);
    return (
      // <Layout style={{paddingTop:20}}>
      //   <Sider
      //     trigger={null}
      //     collapsible
      //     collapsed={this.state.collapsed}

      //   >
      //     <div className="logo" />
      //     <Menu theme="dark" mode="inline" defaultSelectedKeys={['']}>
      //       <Menu.Item key="1">
      //         <Icon type="dashboard" />
      //         <span>Dashboard</span>
      //       </Menu.Item>
      //       <Menu.Item key="2">
      //       <Icon type="file-sync" theme="outlined" />
      //        <span><Link to="/form">Invoice</Link></span>
      //       </Menu.Item>
      //       <SubMenu
      //         key="sub1"
      //         title={<span><Icon type="file-sync" /><span>Invoice</span></span>}
      //       >
      //         <Menu.Item key="3"><span><Link to="/form">Create Invoice</Link></span></Menu.Item>
      //         <Menu.Item key="4">Bill</Menu.Item>
      //         <Menu.Item key="5">Alex</Menu.Item>
      //       </SubMenu>
      //       <Menu.Item key="3">
      //       <Icon type="eye" theme="outlined" />
      //         <span>View</span>
      //       </Menu.Item>
      //       <Menu.Item key="4">
      //       <Icon type="sync" theme="outlined" />
      //         <span>Update Invoices</span>
      //       </Menu.Item>
      //       <Menu.Item key="5">
      //       <Icon type="delete" theme="outlined" />
      //         <span>Delete Invoices</span>
      //       </Menu.Item>
      //     </Menu>
      //   </Sider>
      //   <Layout>
      //     <Header style={{ background: '#fff', paddingRight: 2550 }}>
      //       <Icon
      //         className="trigger"
      //         type={this.state.collapsed ? 'menu-unfold' : 'menu-fold'}
      //         onClick={this.toggle}
      //       />
      //     </Header>
      //        <Content style={{ margin: '24px 16px', padding: 24, background: '#fff', minHeight: 280 }}>

      //            {this.props.children}

      //        </Content>

      //   </Layout>
      // </Layout>

      <Layout style={{ minHeight: "100vh" }}>

        <Sider
          collapsible
          collapsed={this.state.collapsed}
          onCollapse={this.onCollapse}
        >
         <img style={{width:80, marginLeft:10, backgroundColor:'white', marginTop:50}} src={require('../../image/Logo.png')} />
         <span style={{paddingLeft:20, color:"white", position:"absolute", paddingTop: 45 }}><strong>ADMIN</strong></span>

          <div className="logo" />
          <Menu theme="dark" mode="inline" defaultSelectedKeys={[""]}>
            <Menu.Item key="1">
              <Icon type="dashboard" />
              <span>
                <Link to="/defaultLayout">Dashboard</Link>
              </span>
            </Menu.Item>
            {/* <Menu.Item key="2">
              <Icon type="desktop" />
              <span>Option 2</span>
            </Menu.Item> */}
            <SubMenu
              key="sub1"
              title={
                <span>
                  <Icon type="file-sync" />
                  <span>Invoice</span>
                </span>
              }
            >
              <Menu.Item key="2">
                <span>
                  <Link to="/form">
                    <Icon type="form" theme="outlined" />
                    Create Invoice
                  </Link>
                </span>
              </Menu.Item>
              <Menu.Item key="3">
                <span>
                  <Icon type="sync" theme="outlined" />
                  <Link to="/updateForm">Update</Link>
                </span>
              </Menu.Item>
              <Menu.Item key="4">
                <span>
                  <Icon type="eye" theme="outlined" />
                  <Link to="/viewInvoice">View</Link>
                </span>
              </Menu.Item>
              <Menu.Item key="5">
                <Icon type="delete" theme="outlined" />
                Delete
              </Menu.Item>
            </SubMenu>
            <SubMenu
              key="sub2"
              title={
                <span>
                  <Icon type="team" />
                  <span>Team</span>
                </span>
              }
            >
              <Menu.Item key="6">Team 1</Menu.Item>
              <Menu.Item key="7">Team 2</Menu.Item>
            </SubMenu>
            <Menu.Item key="8">
              <Icon type="file" />
              <span>File</span>
            </Menu.Item>
          </Menu>
        </Sider>
        <Layout>
          <Header style={{ background: "#fff", padding: 0 }}>
            <Icon
              className="trigger"
              type={this.state.collapsed ? "menu-unfold" : "menu-fold"}
              onClick={this.toggle}
              style={{ marginLeft: 10 }}
            />
          </Header>

          <Content style={{ margin: "0 16px" }}>
            <Breadcrumb style={{ margin: "16px 0" }}>
              <Breadcrumb.Item />
              <Breadcrumb.Item />
            </Breadcrumb>
            <div
              className="content"
              style={{ padding: 24, background: "#fff" }}
            >
              {this.props.children}
            </div>
          </Content>
          <Footer style={{ textAlign: "center" }}>
            INFINITI 7 ©2018 Created by Infiniti7
          </Footer>
        </Layout>
      </Layout>
    );
  }
}

export default Defaultlayout;
